import styled from 'styled-components';
import Link from 'next/link';

const CollectionItemStyles = styled(Link)`
  background: #ced8ec;
  padding: 2rem;
  text-align: center;

  .collection-item-title {
    text-transform: uppercase;
    color: lightblue;
  }
`;

export { CollectionItemStyles };
